import React from 'react'


function AudioMessage({message}) {

    return (
        <div>
           <audio  >
              <source style={{'background-color':'green'}}
              src={message.recordURL} 
              type="audio/mp3"/>
            </audio>
        </div>
    )
}

export default AudioMessage
